import { Link } from 'react-router-dom';

export default function Navbar() {
  return (
    <nav className="bg-gray-800 p-4">
      <div className="container mx-auto flex justify-between">
        <Link to="/" className="text-white text-xl font-bold">Affiliate Site</Link>
        <div className="space-x-4">
          <Link to="/admin" className="text-gray-300 hover:text-white">Admin</Link>
          <Link to="/affiliate" className="text-gray-300 hover:text-white">Affiliate</Link>
        </div>
      </div>
    </nav>
  );
}
